import React from "react";

function Add() {
  return (
    // <div className="addContainer">
    //   <input type="text" placeholder="title" className="AddTitle"/>
    //   <textarea name="" id="" cols="20" rows="5" />
    //   <input type="date" />
    //   <select id="date-range" class="form-control" name="date">
    //     <option value="yesterday">15th June 2019 (Yesterday) </option>
    //     <option selected value="today">
    //       16th June 2019 (Today)
    //     </option>
    //     <option value="tomorrow">17th June 2019 (Tomorrow) </option>
    //   </select>
    //   <input type="button" value="Save" />
    //   <input type="button" value="Cancel" />
    // </div>
    <div className="container">
      <div className="row">
        <div className="col-25">
          <label for="Title">Title</label>
        </div>
        <div className="col-75">
          <input
            type="text"
            className="Title"
            name="Title"
            placeholder="Your Title.."
          />
        </div>
      </div>
      <div className="row">
        <div className="col-25">
          <label for="date">Date</label>
        </div>
        <div className="col-75">
          <input type="date" className="date" name="date" />
        </div>
      </div>
      <div className="row">
        <div className="col-25">
          <label for="day">Country</label>
        </div>
        <div className="col-75">
          <select className="date-range" class="form-control" name="date">
            <option value="yesterday">15th June 2019 (Yesterday) </option>
            <option selected value="today">
              16th June 2019 (Today)
            </option>
            <option value="tomorrow">17th June 2019 (Tomorrow) </option>
          </select>
        </div>
      </div>
      <div className="row">
        <div className="col-25">
          <label for="Note">Note</label>
        </div>
        <div className="col-75">
          <textarea
            className="note"
            name="subject"
            placeholder="Write something.."
            style={"height:200px"}
          />
        </div>
      </div>
      <div className="row">
        <input type="button" value="Save" />
      </div>
    </div>
  );
}

export default Add;
